$("#delete").click(e=>{SwalFire({icon:"warning",input:"password",title:"Supprimer votre compte est définitif. Il n'est pas possible de le récupérer.",text:'Seules les recherches sont gardées afin de ne pas perdre les valeurs des tops de la page "Données". Mais elles sont anonymisées.',confirmButtonText:"Valider",denyButtonText:"Annuler",showDenyButton:!0,preConfirm:e=>{if(!(e.length<=0))return e;Swal.showValidationMessage("Veuillez saisir votre mot de passe.")}}).then(e=>{e.isConfirmed&&$.post("/api/account/datas/delete",{mdp:e.value},()=>{window.location=window.location.protocol+"//"+window.location.host}).fail(e=>SwalFire({icon:"error",title:"Erreur",text:e.responseText}))})});